    "def overlap(my_list, length, tot_length, seg_length):\n",
    "    start = 0\n",
    "    temp = np.zeros(tot_length)\n",
    "\n",
    "    for l in my_list:\n",
    "        if start >= tot_length:\n",
    "            break\n",
    "        for i in range(length):\n",
    "            if start + i >= tot_length:\n",
    "                break\n",
    "            temp[start + i] += l[i]\n",
    "\n",
    "        start += seg_length\n",
    "    return temp\n",
    "\n",
